import React from "react";
import Users from "../components/Users";

const Listusers = ({ props }) => {
  return (
    <div className="flex-card">
      {props.map((user, i) => {
        return (
          <div key={i}>
            <Users user={user} />
          </div>
        );
      })}
    </div>
  );
};
export default Listusers;
